import React from "react";
import "./index.css";

function TwoSec(props){
    return(
        <div className="first">
            <img src={props.Sorce}/>
            <h2>{props.h2}</h2>
            <p>{props.para}</p>
        </div>
    )
}
export default TwoSec;
